import React from 'react';
import {useEffect} from 'react';
import {useState} from 'react';
import axios from 'axios';

const Nba = () => {

    const [Nba, setNBA] = useState([])

    useEffect(() => {
        const fetchAllTeams = async () => {
            try{
                const res = await axios.get("http:localhost:3001/nbateams")
                setNBA(res.data);
            }catch(err){
                console.log(err);
            }
        }
        fetchAllTeams()
    }, []);

    return (
        
        <div>
            <h1>NBA</h1>
            {Nba.map(nbaTeam=>(
                <div className="nbaTeam">

                </div>   
            ))}
        </div>
    )
}

export default Nba;
